export default function SideNav () {
    const style = {
        navItem: ''
    }
    return (
        <div className="flex flex-wrap flex-column border border-c1 bg-color-c2 text-center w-full h-full bg-c1">
            <h1 className="text-white text-4xl w-full mt-12 h-20">dogPark</h1>
            <div className="w-full h-58 border border-c1 flex justify-center">
                <img src="https://place-puppy.com/" alt=""/>
                <div className="flex flex-column">
                    <button className={style.navItem}>Name</button>
                    <button className={style.navItem}>Location</button>
                    <button className={style.navItem}>status</button>
                </div>
            </div>

        </div>
    )
}
